import React from "react";
import ProfessorGraph from "./Components/ProfessorGraph";
import "./App.css";

function App() {

  const graphData = {
    nodes: [
      { id: "Professor Arti", group: 0, size: 100 }, // Central node, larger size
      { id: "Professor A", group: 1, size: 5 },
      { id: "Professor B", group: 1, size: 5 },
      { id: "Professor C", group: 1, size: 5 }
    ],
    links: [
      { source: "Professor Arti", target: "Professor A", value: 2 },
      { source: "Professor Arti", target: "Professor B", value: 2 },
      { source: "Professor Arti", target: "Professor C", value: 2 }
    ]
  };



  return (
    <div>
      <h1 className="h1">Professor Arti Graph View</h1>
      {/* <GraphView /> */}
      <ProfessorGraph data={graphData} ></ProfessorGraph>
    </div>
  );
}

export default App;
